  input: TEXT,F3XA,,"Enc. pls find a response to your request for add. info. w/regard
    to the mid-year rpt.  In addition to the info., I thought add. explanation was
    nec.The BBCTC is an umbrella organ. covering the various constr. unions in the
    AFL-CIO. The Trades Council helps to coordinate activities such as major project
    and stabilization agreements, work on prevailing wages and otherwise help in labor
    issues of common interest to all construction unions. The officers are elected
    from the participating Local unions and other than the Business Manager receive
    no salary. Generally, the treasurer, who has responsibility for BUILD, the PAC,
    is unpaid and is from another local. Most other locals have their own state PACs
    and have a mechanism through their International Union of contributing to federal
    candidates. w/o many persons knowledge, BUILD at some point began filing both
    federal and state PAC reports while having only one account set up. It is the
    same thing as a person filing a state and federal income tax form using the same
    numbers. The account was the same and the numbers entered on eeach report were
    the same. Ninety-nine % of the activity of the PAC was state activity.  In fact
    in the year 1999 the total amount of federal contributions was 00; in the year
    2000 the total was $650 and in 2001 it was $500.All to Ben Cardin.We wd be glad
    to ask him to return $ & give contr's back & close the PAC"
